INSERT INTO `definitions` (`id`, `name`, `description`, `status`, `creator_id`, `author_id`, `requestor_id`, `requested_at`, `published_at`, `created_at`, `updated_at`) VALUES
(1, 'Reaktionsquote', 'Die Reaktionsquote gibt an, wie schnell sich Unternehmen bei freigeschalteten Kontakten melden. Ist ein Unternehmen langsamer als 48 Stunden, verschlechtert sich der Score.', 'published', 1, 1, NULL, NULL, '2019-09-04 20:59:48', '2019-09-05 02:29:48', '2019-09-05 02:29:48'),
(2, 'Erfolgsindex', 'Der Erfolgsindex gibt an, wie erfolgreich Unternehmen über Road Heroes schon eingestellt haben. Positiv wird dieser Index beeinflusst, sobald ein Unternehmen über uns eingestellt hat und uns dies mitteilt.', 'published', 1, 1, NULL, NULL, '2019-09-04 21:00:35', '2019-09-05 02:30:35', '2019-09-05 02:30:35'),
(3, 'Beliebtheit', 'Die Beliebtheit sagt aus, wie attraktiv die Angebote des Unternehmens sind. Der Wert wird aus dem Verhältnis zwischen Kontakt-Freischaltungen und Aufrufe der Anzeige berechnet.', 'published', 1, 1, NULL, NULL, '2019-09-04 21:01:59', '2019-09-05 02:31:59', '2019-09-05 02:31:59'),
(4, 'Slots', 'Slots können von Unternehmen gebucht werden, um Kampagnen zu \"boosten\". Kampagnen, die mit einem Slot versehen werden, werden proaktiv an die Kontakte aus der Zielgruppe gesendet.', 'published', 1, 1, NULL, NULL, '2019-09-04 21:03:22', '2019-09-05 02:33:22', '2019-09-05 02:33:22'),
(5, 'Zielgruppe', NULL, 'requested', 1, NULL, 1, '2019-09-04 21:11:52', NULL, '2019-09-05 02:41:52', '2019-09-05 02:41:52'),
(6, 'Kampagne', 'Siehe Stellenangebote. Bitte diese Definiton löschen.', 'published', 1, 12894, 1, '2019-09-04 21:14:16', '2019-10-17 09:44:09', '2019-09-05 02:44:16', '2019-10-17 15:14:09'),
(7, 'Kampagne (ab 05.10.2019)', 'Kampagnen können von Unternehmen gebucht werden, um Stellenangebote zu \"boosten\". Stellenangebote in einer Kampagne werden proaktiv an die Kontakte aus der Zielgruppe gesendet.', 'published', 12894, 12894, NULL, NULL, '2019-10-17 09:40:22', '2019-10-17 15:10:22', '2019-10-17 15:10:22'),
(8, 'Stellenangebote', 'Stellenangebote sind alle Jobs, die Unternehmen für ihre Stellen auf unserer Plattform anbieten können. Der Job-Feed ist für jeden jederzeit online zugänglich und alle Stellenangebote, unabhängig von Kampagnen, werden dort aufgelistet. Das anbieten eines Stellenangebots ist im Umfang des Produktpaketes kostenlos inklusive. Stellenangebote können durch eine Kampagne aktiv geboostet werden (kostenpflichtig).', 'requested', 1, NULL, 1, '2019-09-04 21:14:16', NULL, '2019-10-17 15:13:19', '2019-10-17 15:13:19');
