INSERT INTO `videos` (`id`, `creator_id`, `author_id`, `title`, `description`, `views`, `rating`, `length`, `wistia_id`, `sort`, `published_at`, `created_at`, `updated_at`) VALUES
(1, 4, 4, 'Tutorial #1 – Die Grundlagen', 'In diesem Video gibt es einen kleinen, aber feinen Überblick über das, was Sie in den Tutorials erwartet, um Sie bei der Reise zum Personalvertriebler zu unterstützen.', 1699, NULL, 1000, 'l1ki7x8w81', 1000, '2018-11-02 08:14:32', '2018-11-02 02:02:18', '2021-05-03 17:57:16'),
(2, 4, 4, 'Tutorial #2 – Einen Recruiting-Prozess aufbauen', 'Wann sind Unternehmen im Vertrieb erfolgreich? Wenn sie einen Prozess aufbauen. In diesem Video zeigen wir Ihnen, wie Sie den Prozess für Ihre Recruting aufbauen können, um neue Mitarbeiter einzustellen.', 357, NULL, 1000, 'adiqqtueo7', 1000, '2018-11-01 20:37:46', '2018-11-02 02:02:35', '2021-03-04 13:52:39'),
(3, 4, 4, 'Tutorial #3 - Flirten für Anfänger - Die Ansprache', '\"Was kostest du?\" – Wenn man so im Club angesprochen wird, gibt man dem gegenüber vermutlich keine weitere Chance. Genau so ist es auch bei den Kandidaten. In diesem Video zeigen wir Ihnen auf, wie einfach Sie Ihre potentiellen Mitarbeiter erfolgsversprechend ansprechen.', 344, NULL, 1000, '3wu4lw85bt', 1000, '2018-11-01 20:39:28', '2018-11-02 02:02:48', '2021-03-03 18:33:35'),
(4, 4, 4, 'Tutorial #4 – Verbindlichkeit für das Bewerbungsgespräch erzeugen', 'Klasse, wenn man den Kandidaten zu einem Bewerbungsgespräch überzeugen konnte. Schei**, wenn der Kandidaten aber dann nicht kommt. In diesem Video erfahren Sie, wie Sie Ihrer Chancen auf ein zustande kommendes persönliches Gespräch erhöhen können!', 269, NULL, 1000, '4ofcow5ybb', 1000, '2019-10-17 14:21:10', '2018-11-02 02:03:03', '2021-03-03 18:33:36'),
(5, 4, 4, 'Tutorial #5 – Häufige Objections - Teil 1', 'Vertriebler kennen das. Ein Nein ist ein Ja. In diesem Video erfahren Sie, wie Sie mit Objections (Einwänden) der Kandidaten am Telefon umgehen können, um diese doch von Ihrem Unternehmen und einem persönlichem Termin zu überzeugen.', 224, NULL, 1000, 's1635mc54g', 1000, '2018-11-02 07:32:07', '2018-11-02 02:03:22', '2021-03-04 13:58:42'),
(6, 4, 4, 'Software #1 – Das Dashboard', 'Das Dashboard zeigt Ihnen auf einem Blick, wie effektiv und wirtschafltlich Ihr Recrutingprozess ist.', 253, NULL, 1000, '2a736gdse0', 1000, '2018-11-01 20:43:38', '2018-11-02 02:03:53', '2021-03-04 13:58:47'),
(7, 4, 4, 'Software #2 – Einstellungen', 'Es gibt ein paar Einstellungen, die Sie vornehmen können. In diesem Video zeigen wir, was sich hinter diesem Menüpunkt verbirgt.', 240, NULL, 1000, 'l3v2bcucc6', 1000, '2018-11-01 20:44:13', '2018-11-02 02:04:24', '2021-03-04 13:52:48'),
(8, 4, 4, 'Software #3 – Zielgruppen erstellen', 'Wir wollen Ihren Aufwand so gering wie möglich halten. Also bieten wir durch Zielgruppen die Möglichkeit nur die Kandidaten freizuschalten, die genau auf Ihrer Wünsche auf Basis der Hard-Facts zutreffen.', 237, NULL, 1000, '3ewd4mqu34', 1000, '2018-11-01 20:45:16', '2018-11-02 02:04:43', '2021-03-03 18:33:40'),
(9, 4, 4, 'Software #4 – Kampagnen', 'Nachdem Sie eine Zielgruppe erstellt haben, können Sie diese in einer Kampagne verwenden, um schon bald potentielle und passende Kandidaten freizuschalten.', 289, NULL, 1000, 'klxqpawxsa', 1000, '2019-01-28 22:40:19', '2018-11-02 02:05:04', '2022-02-07 14:28:57'),
(10, 4, 4, 'Software #5 – Freigeschaltete Kontakt', 'In diesem Video zeigen wir Ihnen kurz, was ein freigeschalter Fahrer ist und welche Informationen Sie von den Kandidaten erhalten.', 236, NULL, 1000, 'qd5ic907ul', 1000, '2019-02-06 08:49:41', '2018-11-02 02:05:21', '2021-03-03 18:33:42'),
(11, 6828, 6828, 'Partner #1 - CVs von Kandidaten erhalten', 'In diesem Video zeigt Ihnen Anna, wie Sie mit Road Heroes effektiv Lebenslauf-Daten von einem Kandidaten erhalten.', 25, NULL, 402, '1k4x1exehf', 1000, '2019-02-14 10:24:49', '2019-02-14 15:54:49', '2019-06-25 13:35:24');
